import logo from './logo.svg';
import './App.css';
import { PersonaService } from './services/PersonaService';


export class App extends Component{
  constructor(){
    super();
    this.setState({
      persona: []
    });
    this.personaService = new PersonaService();
  }

  componentDidMount(){
    this.personaService.getAll().then(data => {
      console.log(data);
    })
  }

  render(){
    return (
      <h1>Hola Mundo</h1>
    );
  }
}
